import React from 'react';
import './App.css';
import Home from "./components/Home";
import Navigation from "./components/Navigation";
import MainSection from "./components/MainSection";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="App">
      <Navigation />
      <Header />
      <MainSection />
      <Footer />
    </div>
  );
}

export default App;
